shared_styles:
@keyframes fadeIn { from { opacity: 0; transform: translateY(10px); } to { opacity: 1; transform: translateY(0); } }
@keyframes float { 0%, 100% { transform: translateY(0) rotate(0deg); } 50% { transform: translateY(-20px) rotate(5deg); } }
@keyframes shake { 0%, 100% { transform: translateX(0); } 10%, 30%, 50%, 70%, 90% { transform: translateX(-4px); } 20%, 40%, 60%, 80% { transform: translateX(4px); } }
@keyframes blink { 0%, 100% { opacity: 1; } 50% { opacity: 0; } }
@keyframes popIn { 0% { transform: scale(0) rotate(-10deg); opacity:0; } 60% { transform: scale(1.2) rotate(3deg); } 100% { transform: scale(1) rotate(0); opacity:1; } }
@keyframes slideDown { from { transform: translateY(-20px); opacity:0; } to { transform: translateY(0); opacity:1; } }
.anim-fade { animation: fadeIn 0.3s ease-out; }
.anim-float { animation: float 6s ease-in-out infinite; }
.anim-shake { animation: shake 0.5s ease-in-out; }
.anim-blink { animation: blink 1s step-end infinite; }
.anim-pop { animation: popIn 0.5s cubic-bezier(0.34,1.56,0.64,1); }
.anim-slide { animation: slideDown 0.3s ease-out; }
.crt-overlay { position:absolute; inset:0; pointer-events:none; background: repeating-linear-gradient(0deg, rgba(0,0,0,0.12) 0px, rgba(0,0,0,0.12) 1px, transparent 1px, transparent 3px); z-index:10; }
body { background: #0d0a12; }

