function MenuPage({storage, globalState, setGlobalState}) {
  const [bootLines, setBootLines] = useState([]);
  const [showMenu, setShowMenu] = useState(false);
  const [stats, setStats] = useState({});
  const navigate = useNavigate();

  const BOOT = [
    ['> Initializing Odoo Snake Engine v19.0.420.69...', 300],
    ['> Loading dependency graph...', 400],
    ['> Resolving 847 circular dependencies... (this is fine)', 800],
    ['> Installing base module... ✓', 250],
    ['> Installing snake module... ✓', 200],
    ['> Installing meme module... ✓', 200],
    ['> Running 0 tests (we don\'t do that here)... ✓', 500],
    ['> Checking license... LGPL-3 (it\'s free real estate)', 300],
    ['> Compiling excuses for downtime... ✓', 200],
    ['> Warming up the production database... ✓', 250],
    ['> Snake ready. May your deploys be smooth. 🐍', 400],
  ];

  useEffect(() => {
    let alive = true;
    (async () => {
      const saved = await storage.get('gameData', {});
      setStats(saved);
      if (saved.settings) setGlobalState(s => ({...s, settings: {...s.settings, ...saved.settings}}));
      for (const [text, delay] of BOOT) {
        if (!alive) return;
        await new Promise(r => setTimeout(r, delay));
        if (alive) setBootLines(p => [...p, text]);
      }
      await new Promise(r => setTimeout(r, 500));
      if (alive) setShowMenu(true);
    })();
    return () => { alive = false; };
  }, []);

  const floaters = ['💰','📦','📊','👥','🏭','🛒','✉️','📋','🚗','🖥️','🌐','🏷️'];

  return (
    <div className='min-h-screen bg-[#0d0a12] flex flex-col items-center justify-center p-4 overflow-hidden relative'>
      <div className='fixed inset-0 overflow-hidden pointer-events-none'>
        {floaters.map((e, i) => (
          <div key={i} className='absolute text-4xl opacity-[0.04] anim-float'
               style={{left:`${8+i*7.5}%`, top:`${15+(i%4)*20}%`, animationDelay:`${i*0.6}s`, animationDuration:`${5+i%4}s`}}>
            {e}
          </div>
        ))}
      </div>

      {!showMenu && (
        <div className='bg-gray-900/50 border border-purple-800/30 rounded-lg p-4 max-w-lg w-full font-mono relative z-10'>
          <div className='flex items-center gap-2 mb-3 border-b border-purple-800/20 pb-2'>
            <div className='w-3 h-3 rounded-full bg-red-500'/>
            <div className='w-3 h-3 rounded-full bg-yellow-500'/>
            <div className='w-3 h-3 rounded-full bg-green-500'/>
            <span className='text-purple-400 text-xs ml-2'>odoo-snake-terminal</span>
          </div>
          {bootLines.map((line, i) => (
            <div key={i} className='text-green-400 text-xs mb-1 anim-fade'>{line}</div>
          ))}
          <span className='text-green-400 anim-blink'>█</span>
        </div>
      )}

      {showMenu && (
        <div className='text-center anim-fade relative z-10'>
          <div className='text-8xl mb-4 anim-pop'>🐍</div>
          <h1 className='text-5xl sm:text-6xl font-black mb-2'>
            <span className='bg-gradient-to-r from-purple-400 via-pink-400 to-teal-400 bg-clip-text text-transparent'>
              ODOO SNAKE
            </span>
          </h1>
          <p className='text-purple-500 text-sm font-mono mb-8'>Enterprise Resource Slithering™ v19.0.420.69</p>

          <div className='flex flex-col gap-3 mb-8 max-w-xs mx-auto'>
            <button onClick={() => navigate('/play')}
              className='bg-gradient-to-r from-purple-600 to-teal-600 hover:from-purple-500 hover:to-teal-500 text-white px-8 py-3.5 rounded-xl font-bold text-lg transition shadow-lg shadow-purple-900/50 active:scale-95'>
              🎮 DEPLOY SNAKE
            </button>
            <button onClick={() => navigate('/leaderboard')}
              className='bg-gray-800/80 hover:bg-gray-700 text-purple-300 px-8 py-3 rounded-xl font-mono transition border border-purple-800/30'>
              🏆 Leaderboard
            </button>
            <button onClick={() => navigate('/settings')}
              className='bg-gray-800/80 hover:bg-gray-700 text-purple-300 px-8 py-3 rounded-xl font-mono transition border border-purple-800/30'>
              ⚙️ Settings
            </button>
            <button onClick={() => navigate('/about')}
              className='text-purple-600 hover:text-purple-400 text-sm transition mt-2'>
              About this masterpiece
            </button>
          </div>

          {stats.totalGames > 0 && (
            <div className='bg-gray-900/50 border border-purple-800/20 rounded-lg p-4 max-w-sm mx-auto anim-fade'>
              <h3 className='text-purple-400 text-xs font-mono mb-2 tracking-widest'>CAREER STATS</h3>
              <div className='grid grid-cols-2 gap-x-4 gap-y-1 text-xs'>
                <div className='text-purple-400'>Games Played</div>
                <div className='text-white font-mono text-right'>{stats.totalGames}</div>
                <div className='text-purple-400'>Total Revenue</div>
                <div className='text-green-400 font-mono text-right'>${(stats.totalScore||0).toLocaleString()}</div>
                <div className='text-purple-400'>Modules Installed</div>
                <div className='text-teal-400 font-mono text-right'>{stats.totalModules||0}</div>
                <div className='text-purple-400'>High Score</div>
                <div className='text-yellow-400 font-mono text-right'>${(stats.highScore||0).toLocaleString()}</div>
                <div className='text-purple-400'>Total Crashes</div>
                <div className='text-red-400 font-mono text-right'>{stats.totalDeaths||0}</div>
              </div>
            </div>
          )}

          <p className='text-purple-800 text-xs mt-8 italic max-w-xs mx-auto'>
            "I didn't ask for a snake game in our ERP, but here we are."<br/>— Your Project Manager, probably
          </p>
        </div>
      )}
    </div>
  );
}

