app = env['mcp.webapp'].sudo().search([('slug', '=', 'snake-odoo')], limit=1)
records = env['mcp.webapp.user.storage'].sudo().search_read(
    [('webapp_id', '=', app.id)],
    ['user_id', 'data']
)
scores = []
for rec in records:
    try:
        data = json.loads(rec['data']) if isinstance(rec['data'], str) else rec['data']
        gd = data.get('gameData', {})
        last = gd.get('lastGame', {})
        hs = gd.get('highScore', 0)
        if hs > 0:
            uname = rec['user_id'][1] if rec['user_id'] else 'Anonymous'
            scores.append({
                'name': uname,
                'score': hs,
                'modules': last.get('modules', 0),
                'time': last.get('time', 0),
                'games': gd.get('totalGames', 0),
            })
    except Exception:
        pass
scores.sort(key=lambda x: x['score'], reverse=True)
result = {'scores': scores[:20]}

