function PlayPage({storage, user, globalState, setGlobalState}) {
  const GW=20, GH=20;
  const SPEEDS = {slow:200, normal:130, fast:80, ludicrous:40};
  const MODULES = [
    {name:'CRM',emoji:'💰',color:'#714B67',pts:10,msg:'Pipeline is now a snake!'},
    {name:'Sales',emoji:'🛒',color:'#017e84',pts:15,msg:'Adding approval workflows...'},
    {name:'Inventory',emoji:'📦',color:'#EB6E00',pts:12,msg:'Counting virtual boxes...'},
    {name:'Accounting',emoji:'📊',color:'#00A09D',pts:20,msg:'Snake is now tax-deductible!'},
    {name:'HR',emoji:'👥',color:'#5B899E',pts:8,msg:'Snake requests time off.'},
    {name:'Project',emoji:'📋',color:'#7C6576',pts:11,msg:'47 Kanban columns created...'},
    {name:'Purchase',emoji:'🏷️',color:'#9B59B6',pts:14,msg:'Budget? What budget?'},
    {name:'MRP',emoji:'🏭',color:'#AD5E99',pts:18,msg:'BOM exploded (literally).'},
    {name:'Website',emoji:'🌐',color:'#2ECC71',pts:13,msg:'Blog nobody will read...'},
    {name:'Discuss',emoji:'✉️',color:'#21b799',pts:5,msg:'999+ unread messages!'},
    {name:'POS',emoji:'🖥️',color:'#00A09D',pts:16,msg:'Receipt printer goes brrr...'},
    {name:'Fleet',emoji:'🚗',color:'#3aadaa',pts:9,msg:'Snake has a company car!'},
  ];
  const POWERUPS = [
    {name:'sudo()',emoji:'🔓',color:'#FFD700',fx:'invincible',dur:5000,msg:'Access rights? What access rights?'},
    {name:'cache.clear()',emoji:'🧹',color:'#00FFFF',fx:'slow',dur:4000,msg:'Everything runs slower now.'},
    {name:'UserError()',emoji:'⚠️',color:'#FF4444',fx:'reverse',dur:3000,msg:'Controls reversed! Feature, not bug.'},
    {name:'--dev=reload',emoji:'🔄',color:'#00FF00',fx:'shrink',dur:0,msg:'Hot reload! Lost some segments...'},
    {name:'pip install',emoji:'📥',color:'#FF69B4',fx:'speed',dur:4000,msg:'Installing dependencies of dependencies...'},
  ];
  const ACHIEVES = [
    {id:'first_deploy',name:'First Deploy',icon:'🚀',desc:'Install your first module',cond:s=>s.e>=1},
    {id:'spaghetti',name:'Spaghetti Code',icon:'🍝',desc:'Reach length 20',cond:s=>s.l>=20},
    {id:'full_stack',name:'Full Stack Dev',icon:'🥞',desc:'5 unique modules in one game',cond:s=>s.u>=5},
    {id:'enterprise',name:'Enterprise Edition',icon:'💎',desc:'Score over 200',cond:s=>s.s>=200},
    {id:'survivor',name:'Production Server',icon:'🏚️',desc:'Survive 60 seconds',cond:s=>s.t>=60},
    {id:'power_user',name:'Power User',icon:'⚡',desc:'Collect 3 power-ups',cond:s=>s.p>=3},
    {id:'marathon',name:'Go-Live Weekend',icon:'😰',desc:'Reach length 40',cond:s=>s.l>=40},
    {id:'perfectionist',name:'Zero Bugs™',icon:'🐛',desc:'Score 500+',cond:s=>s.s>=500},
  ];
  const DEATH_MSGS = [
    'Traceback (most recent call last):\n  File "snake.py", line 42, in move\n    self.body.collide(self.head)\nRecursionError: maximum snake depth exceeded',
    'psycopg2.OperationalError:\nFATAL: the snake ate itself\nHINT: Have you tried not crashing?',
    'odoo.exceptions.ValidationError:\nConstraint "snake_no_self_eat" violated!\nThe snake cannot be its own lunch.',
    'werkzeug.exceptions.NotFound:\n404: Snake Not Found\nThe requested snake has left the grid.',
    'MemoryError: Snake too long.\nConsider upgrading to Odoo Enterprise™\nfor only $999/month/segment',
    'odoo.exceptions.AccessError:\nSorry, you do not have permission\nto crash into walls. Contact admin.',
    'TimeoutError: Response time exceeded 30s.\nThe snake was probably stuck in a\ncode review with 47 comments.',
    'IntegrityError: UNIQUE constraint failed:\ntwo_heads_one_cell. This violates both\ndatabase theory AND biology.',
  ];
  const TIPS = [
    'Walls are NOT a feature.','Every module adds technical debt.',
    'This game has more features than your last sprint.',
    'Eating yourself is O(1) but costs O(n) dignity.',
    'The snake uses agile methodology. It pivots a lot.',
    'No animals were harmed. Modules, however...',
    'This snake has better uptime than your staging server.',
    'Remember: deployments on Friday are snake food.',
  ];

  const canvasRef = useRef(null);
  const G = useRef(null);
  const tickRef = useRef(null);
  const rafRef = useRef(null);
  const phRef = useRef('READY');
  const stRef = useRef({speed:'normal',crt:false,particles:true,sound:true,grid:true,mode:'community'});
  const achRef = useRef([]);
  const partRef = useRef([]);
  const acRef = useRef(null);
  const tidRef = useRef(0);
  const swRef = useRef({x:0,y:0});

  const [phase, _setPhase] = useState('READY');
  const [score, setScore] = useState(0);
  const [hi, setHi] = useState(0);
  const [combo, setCombo] = useState(0);
  const [toasts, setToasts] = useState([]);
  const [dMsg, setDMsg] = useState('');
  const [dStats, setDStats] = useState({});
  const [shaking, setShaking] = useState(false);
  const [aPow, setAPow] = useState(null);
  const [newAch, setNewAch] = useState(null);
  const [modEmojis, setModEmojis] = useState([]);
  const setPhase = (p) => { phRef.current = p; _setPhase(p); };

  useEffect(() => {
    const s = globalState?.settings;
    if (s) stRef.current = {...stRef.current, ...s};
  }, [globalState?.settings]);

  useEffect(() => {
    (async () => {
      const saved = await storage.get('gameData', {});
      setHi(saved.highScore || 0);
      achRef.current = saved.achievements || [];
      if (saved.settings) {
        stRef.current = {...stRef.current, ...saved.settings};
        setGlobalState(prev => ({...prev, settings: {...prev.settings, ...saved.settings}}));
      }
    })();
    return () => {
      if (tickRef.current) clearInterval(tickRef.current);
      if (rafRef.current) cancelAnimationFrame(rafRef.current);
    };
  }, []);

  const getAC = () => {
    if (!acRef.current) try { acRef.current = new (window.AudioContext||window.webkitAudioContext)(); } catch(e) {}
    return acRef.current;
  };
  const tone = (f,d,t,v) => {
    if (!stRef.current.sound) return;
    try {
      const c=getAC(); if(!c) return;
      const o=c.createOscillator(), g=c.createGain();
      o.type=t||'square'; o.frequency.setValueAtTime(f,c.currentTime);
      g.gain.setValueAtTime(v||0.1,c.currentTime);
      g.gain.exponentialRampToValueAtTime(0.001,c.currentTime+d);
      o.connect(g); g.connect(c.destination); o.start(); o.stop(c.currentTime+d);
    } catch(e) {}
  };
  const SFX = {
    eat:()=>{tone(523,0.1);setTimeout(()=>tone(659,0.08),50);setTimeout(()=>tone(784,0.12),100);},
    pow:()=>{tone(440,0.08);setTimeout(()=>tone(554,0.08),40);setTimeout(()=>tone(880,0.15),100);},
    die:()=>{tone(200,0.3,'sawtooth',0.15);setTimeout(()=>tone(150,0.3,'sawtooth',0.1),150);setTimeout(()=>tone(100,0.5,'sawtooth',0.08),300);},
    ach:()=>{[523,659,784,1047].forEach((f,i)=>setTimeout(()=>tone(f,0.12,'sine',0.1),i*70));},
  };

  const toast = (msg,icon) => {
    const id=++tidRef.current;
    setToasts(p=>[...p.slice(-3),{id,msg,icon}]);
    setTimeout(()=>setToasts(p=>p.filter(t=>t.id!==id)),3500);
  };

  const burst = (x,y,col,n) => {
    if (!stRef.current.particles) return;
    for (let i=0;i<(n||12);i++) {
      const a=(Math.PI*2/(n||12))*i+Math.random()*0.5, sp=1+Math.random()*3;
      partRef.current.push({x,y,vx:Math.cos(a)*sp,vy:Math.sin(a)*sp,life:1,dec:0.02+Math.random()*0.03,col,sz:2+Math.random()*4});
    }
  };

  const rndFree = (occ) => {
    let p,t=0; do { p={x:Math.floor(Math.random()*GW),y:Math.floor(Math.random()*GH)}; t++; } while(occ.has(p.x+','+p.y)&&t<300); return p;
  };
  const occSet = (g) => {
    const s=new Set(g.snake.map(p=>p.x+','+p.y));
    if(g.food) s.add(g.food.x+','+g.food.y);
    if(g.pow) s.add(g.pow.x+','+g.pow.y);
    return s;
  };
  const spawnFood = (g) => {
    const p=rndFree(occSet(g)), m=MODULES[Math.floor(Math.random()*MODULES.length)];
    g.food={...p,...m};
  };
  const maybeSpawnPow = (g) => {
    if(g.pow||Math.random()>0.18) return;
    const p=rndFree(occSet(g)), pu=POWERUPS[Math.floor(Math.random()*POWERUPS.length)];
    g.pow={...p,...pu,born:g.ticks};
  };

  const checkAch = (g) => {
    const t=(Date.now()-g.t0)/1000;
    const st={e:g.eaten,l:g.snake.length,u:g.uniq.size,s:g.score,t,p:g.pups};
    ACHIEVES.forEach(a => {
      if(!achRef.current.includes(a.id) && a.cond(st)) {
        achRef.current=[...achRef.current,a.id];
        storage.set('gameData',{...(G.current._sd||{}),achievements:achRef.current}).catch(()=>{});
        setNewAch(a); SFX.ach();
        setTimeout(()=>setNewAch(null),4000);
        toast('Achievement: '+a.name+'!',a.icon);
      }
    });
  };

  const dodie = async () => {
    const g=G.current; if(!g) return;
    SFX.die(); setShaking(true); setTimeout(()=>setShaking(false),500);
    if(tickRef.current){clearInterval(tickRef.current);tickRef.current=null;}
    const msg=DEATH_MSGS[Math.floor(Math.random()*DEATH_MSGS.length)];
    const el=Math.round((Date.now()-g.t0)/1000);
    const gs={score:g.score,length:g.snake.length,modules:g.eaten,unique:g.uniq.size,time:el,powerups:g.pups};
    setDMsg(msg); setDStats(gs); setPhase('DEAD');
    try {
      const saved=await storage.get('gameData',{});
      const upd={...saved,highScore:Math.max(saved.highScore||0,g.score),totalGames:(saved.totalGames||0)+1,totalScore:(saved.totalScore||0)+g.score,totalModules:(saved.totalModules||0)+g.eaten,totalDeaths:(saved.totalDeaths||0)+1,achievements:achRef.current,lastGame:gs};
      await storage.set('gameData',upd); g._sd=upd; setHi(upd.highScore);
    } catch(e){}
  };

  const gameTick = () => {
    const g=G.current; if(!g||phRef.current!=='PLAYING') return;
    g.ticks++; g.dir={...g.ndir};
    let nh={x:g.snake[0].x+g.dir.x, y:g.snake[0].y+g.dir.y};
    if(nh.x<0||nh.x>=GW||nh.y<0||nh.y>=GH) {
      if(g.afx==='invincible'){nh.x=(nh.x+GW)%GW;nh.y=(nh.y+GH)%GH;} else {dodie();return;}
    }
    if(g.snake.some(s=>s.x===nh.x&&s.y===nh.y)&&g.afx!=='invincible'){dodie();return;}
    g.snake.unshift(nh); if(g.grow>0)g.grow--;else g.snake.pop();
    if(g.food&&nh.x===g.food.x&&nh.y===g.food.y){
      const now=Date.now(); if(now-g.lastEat<3000)g.combo++;else g.combo=0; g.lastEat=now;
      const pts=Math.round(g.food.pts*(1+g.combo*0.5));
      g.score+=pts; g.eaten++; g.uniq.add(g.food.name); g.grow+=2;
      setScore(g.score); setCombo(g.combo); setModEmojis(p=>[...p,g.food.emoji]);
      const cs=canvasRef.current?canvasRef.current.width/GW:20;
      burst(g.food.x*cs+cs/2,g.food.y*cs+cs/2,g.food.color,15);
      SFX.eat(); toast('Installing '+g.food.name+'... '+g.food.msg,g.food.emoji);
      spawnFood(g); maybeSpawnPow(g); checkAch(g);
    }
    if(g.pow&&nh.x===g.pow.x&&nh.y===g.pow.y){
      const pu=g.pow; g.pups++;
      if(pu.fx==='shrink'){for(let i=0;i<3&&g.snake.length>3;i++)g.snake.pop();}
      else if(pu.fx==='speed'){
        if(tickRef.current)clearInterval(tickRef.current);
        const spd=Math.max(30,getSpeed()*0.5);
        tickRef.current=setInterval(gameTick,spd);
        setTimeout(()=>{if(phRef.current==='PLAYING'&&tickRef.current){clearInterval(tickRef.current);tickRef.current=setInterval(gameTick,getSpeed());}},pu.dur);
      } else {
        g.afx=pu.fx; setAPow(pu);
        if(g.aftimer)clearTimeout(g.aftimer);
        g.aftimer=setTimeout(()=>{g.afx=null;setAPow(null);},pu.dur);
      }
      const cs=canvasRef.current?canvasRef.current.width/GW:20;
      burst(pu.x*cs+cs/2,pu.y*cs+cs/2,pu.color,20);
      SFX.pow(); toast(pu.emoji+' '+pu.name+': '+pu.msg,pu.emoji);
      g.pow=null; checkAch(g);
    }
    if(g.pow&&g.ticks-g.pow.born>80) g.pow=null;
  };

  const getSpeed = () => {
    const s=stRef.current; const base=SPEEDS[s.speed]||130;
    return s.mode==='enterprise'?Math.round(base*0.7):base;
  };

  const initGame = () => {
    const cx=Math.floor(GW/2), cy=Math.floor(GH/2);
    G.current={snake:[{x:cx,y:cy},{x:cx-1,y:cy},{x:cx-2,y:cy}],dir:{x:1,y:0},ndir:{x:1,y:0},food:null,pow:null,afx:null,aftimer:null,score:0,eaten:0,uniq:new Set(),pups:0,t0:Date.now(),lastEat:0,combo:0,grow:0,ticks:0,_sd:null};
    spawnFood(G.current); partRef.current=[];
    setScore(0);setCombo(0);setToasts([]);setAPow(null);setModEmojis([]);
  };

  const startGame = () => {
    initGame(); setPhase('PLAYING'); getAC();
    tickRef.current=setInterval(gameTick,getSpeed());
  };

  const togglePause = () => {
    if(phRef.current==='PLAYING'){clearInterval(tickRef.current);tickRef.current=null;setPhase('PAUSED');}
    else if(phRef.current==='PAUSED'){tickRef.current=setInterval(gameTick,getSpeed());setPhase('PLAYING');}
  };

  useEffect(()=>{
    const h=(e)=>{
      if(e.key==='Escape'||e.key==='p'||e.key==='P'){e.preventDefault();togglePause();return;}
      if(phRef.current==='READY'||phRef.current==='DEAD'){if(e.key==='Enter'||e.key===' '){e.preventDefault();startGame();return;}}
      if(phRef.current!=='PLAYING') return;
      const g=G.current; if(!g) return;
      const rev=g.afx==='reverse';
      let d=null;
      if(e.key==='ArrowUp'||e.key==='w'||e.key==='W') d=rev?{x:0,y:1}:{x:0,y:-1};
      if(e.key==='ArrowDown'||e.key==='s'||e.key==='S') d=rev?{x:0,y:-1}:{x:0,y:1};
      if(e.key==='ArrowLeft'||e.key==='a'||e.key==='A') d=rev?{x:1,y:0}:{x:-1,y:0};
      if(e.key==='ArrowRight'||e.key==='d'||e.key==='D') d=rev?{x:-1,y:0}:{x:1,y:0};
      if(d&&!(d.x===-g.dir.x&&d.y===-g.dir.y)){g.ndir=d;e.preventDefault();}
    };
    window.addEventListener('keydown',h); return()=>window.removeEventListener('keydown',h);
  },[]);

  useEffect(()=>{
    const resize=()=>{
      const c=canvasRef.current; if(!c) return;
      const p=c.parentElement;
      const sz=Math.min(p.clientWidth,p.clientHeight);
      const cs=Math.floor(sz/GW);
      c.width=cs*GW; c.height=cs*GH;
    };
    resize(); window.addEventListener('resize',resize);
    return()=>window.removeEventListener('resize',resize);
  },[]);

  useEffect(()=>{
    let running=true;
    const render=()=>{
      if(!running) return;
      const c=canvasRef.current, g=G.current;
      if(!c||!g){rafRef.current=requestAnimationFrame(render);return;}
      const ctx=c.getContext('2d'), cs=c.width/GW;
      ctx.fillStyle='#0d0a12'; ctx.fillRect(0,0,c.width,c.height);
      if(stRef.current.grid){
        ctx.strokeStyle='rgba(113,75,103,0.12)'; ctx.lineWidth=0.5;
        for(let x=0;x<=GW;x++){ctx.beginPath();ctx.moveTo(x*cs,0);ctx.lineTo(x*cs,GH*cs);ctx.stroke();}
        for(let y=0;y<=GH;y++){ctx.beginPath();ctx.moveTo(0,y*cs);ctx.lineTo(GW*cs,y*cs);ctx.stroke();}
      }
      if(g.food){
        const pulse=1+Math.sin(Date.now()/200)*0.12;
        const fx=g.food.x*cs+cs/2, fy=g.food.y*cs+cs/2;
        ctx.shadowColor=g.food.color; ctx.shadowBlur=12;
        ctx.fillStyle=g.food.color+'30'; ctx.beginPath(); ctx.arc(fx,fy,cs*0.45*pulse,0,Math.PI*2); ctx.fill();
        ctx.shadowBlur=0;
        ctx.font=`${cs*0.65*pulse}px serif`; ctx.textAlign='center'; ctx.textBaseline='middle'; ctx.fillText(g.food.emoji,fx,fy);
        ctx.font=`bold ${Math.max(8,cs*0.26)}px monospace`; ctx.fillStyle=g.food.color; ctx.fillText(g.food.name,fx,fy+cs*0.52);
      }
      if(g.pow){
        const flash=Math.sin(Date.now()/100)>0;
        if(flash){
          const px=g.pow.x*cs+cs/2, py=g.pow.y*cs+cs/2;
          ctx.shadowColor=g.pow.color; ctx.shadowBlur=18;
          ctx.font=`${cs*0.75}px serif`; ctx.textAlign='center'; ctx.textBaseline='middle'; ctx.fillText(g.pow.emoji,px,py);
          ctx.shadowBlur=0;
          ctx.font=`bold ${Math.max(7,cs*0.2)}px monospace`; ctx.fillStyle=g.pow.color; ctx.fillText(g.pow.name,px,py+cs*0.52);
        }
      }
      g.snake.forEach((seg,i)=>{
        const t=i/Math.max(g.snake.length-1,1);
        const r=Math.round(113+(33-113)*t), gr=Math.round(75+(183-75)*t), b=Math.round(103+(153-103)*t);
        const sx=seg.x*cs+1, sy=seg.y*cs+1, ss=cs-2;
        ctx.fillStyle=g.afx==='invincible'?`hsl(${(Date.now()/5+i*20)%360},100%,60%)`:`rgb(${r},${gr},${b})`;
        const rd=cs*0.25;
        ctx.beginPath(); ctx.moveTo(sx+rd,sy);
        ctx.lineTo(sx+ss-rd,sy); ctx.quadraticCurveTo(sx+ss,sy,sx+ss,sy+rd);
        ctx.lineTo(sx+ss,sy+ss-rd); ctx.quadraticCurveTo(sx+ss,sy+ss,sx+ss-rd,sy+ss);
        ctx.lineTo(sx+rd,sy+ss); ctx.quadraticCurveTo(sx,sy+ss,sx,sy+ss-rd);
        ctx.lineTo(sx,sy+rd); ctx.quadraticCurveTo(sx,sy,sx+rd,sy); ctx.fill();
        if(i===0){
          const eo=cs*0.15;
          const e1x=seg.x*cs+cs/2+g.dir.x*eo-g.dir.y*eo*0.6;
          const e1y=seg.y*cs+cs/2+g.dir.y*eo-g.dir.x*eo*0.6;
          const e2x=seg.x*cs+cs/2+g.dir.x*eo+g.dir.y*eo*0.6;
          const e2y=seg.y*cs+cs/2+g.dir.y*eo+g.dir.x*eo*0.6;
          ctx.fillStyle='#fff';
          ctx.beginPath();ctx.arc(e1x,e1y,cs*0.11,0,Math.PI*2);ctx.fill();
          ctx.beginPath();ctx.arc(e2x,e2y,cs*0.11,0,Math.PI*2);ctx.fill();
          ctx.fillStyle='#111';
          ctx.beginPath();ctx.arc(e1x+g.dir.x*2,e1y+g.dir.y*2,cs*0.055,0,Math.PI*2);ctx.fill();
          ctx.beginPath();ctx.arc(e2x+g.dir.x*2,e2y+g.dir.y*2,cs*0.055,0,Math.PI*2);ctx.fill();
        }
      });
      partRef.current=partRef.current.filter(p=>{
        p.x+=p.vx;p.y+=p.vy;p.vx*=0.96;p.vy*=0.96;p.life-=p.dec;
        if(p.life<=0)return false;
        ctx.globalAlpha=p.life; ctx.fillStyle=p.col;
        ctx.beginPath();ctx.arc(p.x,p.y,p.sz*p.life,0,Math.PI*2);ctx.fill();
        ctx.globalAlpha=1; return true;
      });
      if(g.afx==='invincible'){
        ctx.shadowColor='#FFD700';ctx.shadowBlur=25;ctx.strokeStyle='#FFD700';ctx.lineWidth=2;
        ctx.strokeRect(0,0,GW*cs,GH*cs);ctx.shadowBlur=0;
      }
      rafRef.current=requestAnimationFrame(render);
    };
    rafRef.current=requestAnimationFrame(render);
    return()=>{running=false;if(rafRef.current)cancelAnimationFrame(rafRef.current);};
  },[]);

  const onTS=(e)=>{swRef.current={x:e.touches[0].clientX,y:e.touches[0].clientY};};
  const onTE=(e)=>{
    const g=G.current;
    if(phRef.current==='READY'||phRef.current==='DEAD'){startGame();return;}
    if(!g||phRef.current!=='PLAYING') return;
    const dx=e.changedTouches[0].clientX-swRef.current.x, dy=e.changedTouches[0].clientY-swRef.current.y;
    if(Math.abs(dx)<20&&Math.abs(dy)<20){togglePause();return;}
    const rev=g.afx==='reverse'; let d;
    if(Math.abs(dx)>Math.abs(dy)) d=dx>0?(rev?{x:-1,y:0}:{x:1,y:0}):(rev?{x:1,y:0}:{x:-1,y:0});
    else d=dy>0?(rev?{x:0,y:-1}:{x:0,y:1}):(rev?{x:0,y:1}:{x:0,y:-1});
    if(!(d.x===-g.dir.x&&d.y===-g.dir.y)) g.ndir=d;
  };

  const navigate=useNavigate();
  const settings=globalState?.settings||stRef.current;
  return (
    <div className={`min-h-screen bg-[#0d0a12] flex flex-col items-center justify-center p-2 select-none ${shaking?'anim-shake':''}`}
         onTouchStart={onTS} onTouchEnd={onTE}>
      <div className='w-full max-w-[600px] flex justify-between items-center mb-1.5 px-1'>
        <div className='flex items-center gap-3'>
          <button onClick={()=>navigate('/')} className='text-purple-500 hover:text-purple-300 text-xs'>← Menu</button>
          <div className='text-purple-300 font-mono text-sm'>Revenue: <span className='text-green-400 font-bold text-lg'>${score.toLocaleString()}</span></div>
        </div>
        <div className='flex items-center gap-3'>
          {combo>1&&<span className='text-yellow-400 font-bold text-xs animate-pulse'>COMBO x{combo}!</span>}
          <span className='text-purple-400 font-mono text-xs'>Modules: {modEmojis.length}</span>
          <span className='text-purple-600 font-mono text-xs'>Best: ${hi.toLocaleString()}</span>
        </div>
      </div>
      {aPow&&(
        <div className='mb-1 px-3 py-0.5 rounded-full text-xs font-mono animate-pulse'
             style={{backgroundColor:aPow.color+'25',color:aPow.color,border:'1px solid '+aPow.color+'60'}}>
          {aPow.emoji} {aPow.name} ACTIVE
        </div>
      )}
      <div className='relative border-2 border-purple-900/40 rounded-lg overflow-hidden shadow-2xl shadow-purple-900/30'
           style={{width:'min(90vw,600px)',aspectRatio:`${GW}/${GH}`}}>
        <canvas ref={canvasRef} className='block w-full h-full'/>
        {settings.crt&&<div className='crt-overlay'/>}
        {phase==='READY'&&(
          <div className='absolute inset-0 flex flex-col items-center justify-center bg-black/70 backdrop-blur-sm z-20'>
            <div className='text-6xl mb-3 anim-pop'>🐍</div>
            <h2 className='text-2xl font-bold text-purple-300 mb-2'>Ready to Deploy</h2>
            <p className='text-purple-400 text-sm mb-3'>Press ENTER / Space or tap to start</p>
            <p className='text-purple-600 text-xs'>WASD / Arrow Keys • P to pause</p>
            <button onClick={startGame} className='mt-4 bg-purple-600 hover:bg-purple-500 text-white px-6 py-2 rounded-lg font-mono text-sm transition active:scale-95'>
              🚀 Start
            </button>
          </div>
        )}
        {phase==='PAUSED'&&(
          <div className='absolute inset-0 flex flex-col items-center justify-center bg-black/80 backdrop-blur-sm z-20'>
            <div className='text-4xl mb-3'>⏸️</div>
            <h2 className='text-2xl font-bold text-yellow-400 mb-2 font-mono'>DEPLOYMENT FROZEN</h2>
            <p className='text-purple-300 text-sm'>Press ESC / P to resume</p>
            <p className='text-purple-600 text-xs mt-4 italic max-w-xs text-center'>{TIPS[Math.floor(Math.random()*TIPS.length)]}</p>
          </div>
        )}
        {phase==='DEAD'&&(
          <div className='absolute inset-0 flex flex-col items-center justify-center bg-black/85 backdrop-blur-sm z-20 overflow-y-auto p-3'>
            <div className='text-4xl mb-2 anim-pop'>💀</div>
            <h2 className='text-xl font-bold text-red-400 mb-2 font-mono'>PRODUCTION DOWN</h2>
            <div className='bg-red-950/50 border border-red-800/40 rounded-lg p-2.5 mb-3 max-w-sm w-full'>
              <pre className='text-red-300 text-[10px] sm:text-xs font-mono whitespace-pre-wrap leading-relaxed'>{dMsg}</pre>
            </div>
            <div className='grid grid-cols-2 gap-1.5 mb-3 text-xs w-full max-w-xs'>
              <div className='bg-purple-900/30 rounded px-2 py-1 text-center'><div className='text-purple-500 text-[10px]'>Revenue</div><div className='text-white font-bold'>${dStats.score?.toLocaleString()}</div></div>
              <div className='bg-purple-900/30 rounded px-2 py-1 text-center'><div className='text-purple-500 text-[10px]'>Modules</div><div className='text-white font-bold'>{dStats.modules}</div></div>
              <div className='bg-purple-900/30 rounded px-2 py-1 text-center'><div className='text-purple-500 text-[10px]'>Length</div><div className='text-white font-bold'>{dStats.length}</div></div>
              <div className='bg-purple-900/30 rounded px-2 py-1 text-center'><div className='text-purple-500 text-[10px]'>Uptime</div><div className='text-white font-bold'>{dStats.time}s</div></div>
            </div>
            {dStats.score>hi&&<div className='text-yellow-400 font-bold mb-2 animate-pulse text-sm'>🏆 NEW HIGH SCORE! 🏆</div>}
            <div className='flex gap-2'>
              <button onClick={startGame} className='bg-purple-600 hover:bg-purple-500 text-white px-4 py-2 rounded-lg font-mono text-sm transition active:scale-95'>🔄 Redeploy</button>
              <button onClick={()=>navigate('/')} className='bg-gray-700 hover:bg-gray-600 text-white px-4 py-2 rounded-lg font-mono text-sm transition'>Menu</button>
            </div>
          </div>
        )}
      </div>
      {modEmojis.length>0&&(
        <div className='mt-1.5 flex gap-0.5 flex-wrap justify-center max-w-[600px]'>
          {modEmojis.slice(-20).map((e,i)=><span key={i} className='text-base' title='Installed'>{e}</span>)}
        </div>
      )}
      <div className='fixed top-3 right-3 flex flex-col gap-1.5 z-50 pointer-events-none max-w-xs'>
        {toasts.map(t=>(
          <div key={t.id} className='bg-gray-900/90 border border-purple-700/40 rounded-lg px-3 py-1.5 text-xs text-purple-200 font-mono anim-slide backdrop-blur-sm'>
            {t.icon&&<span className='mr-1.5'>{t.icon}</span>}{t.msg}
          </div>
        ))}
      </div>
      {newAch&&(
        <div className='fixed top-1/4 left-1/2 -translate-x-1/2 bg-gradient-to-r from-yellow-900/90 to-amber-900/90 border-2 border-yellow-500 rounded-xl px-6 py-3 text-center z-50 anim-pop shadow-2xl shadow-yellow-500/30'>
          <div className='text-3xl mb-1'>{newAch.icon}</div>
          <div className='text-yellow-300 font-bold'>{newAch.name}</div>
          <div className='text-yellow-200/70 text-xs'>{newAch.desc}</div>
        </div>
      )}
      <div className='mt-1.5 text-purple-700 text-[10px] text-center md:hidden'>Swipe to steer • Tap to pause</div>
    </div>
  );
}

function LeaderboardPage({api, user, storage}) {
