      const saved = await storage.get('gameData', {});
      setMyStats(saved);
      setLoading(false);
    })();
  }, []);

  const medals = ['🥇','🥈','🥉'];

  return (
    <div className='min-h-screen bg-[#0d0a12] p-4'>
