                    <td className='p-2.5 text-purple-300 font-mono'>{medals[i] || (i+1)}</td>
                    <td className='p-2.5 text-white font-mono'>{s.name}{s.name === user.name ? ' ✨' : ''}</td>
                    <td className='p-2.5 text-green-400 text-right font-mono'>${s.score?.toLocaleString()}</td>
                    <td className='p-2.5 text-teal-400 text-right font-mono'>{s.modules}</td>
