        <div className='mt-6 text-center'>
          <button onClick={() => navigate('/play')} className='bg-purple-600 hover:bg-purple-500 text-white px-6 py-2 rounded-lg font-mono text-sm transition'>
            🎮 Play Now
          </button>
        </div>
      </div>
    </div>
  );
}

