        <div className='bg-gray-900/50 border border-purple-800/30 rounded-lg p-4 mb-4'>
          <h2 className='text-purple-500 text-xs font-mono mb-3 tracking-widest'>AUDIO PIPELINE</h2>
          <Toggle label='Sound Effects' desc='8-bit bleeps and bloops via Web Audio API' value={s.sound} onChange={v => upd('sound',v)} />
        </div>

        {achievements.length > 0 && (
          <div className='bg-gray-900/50 border border-purple-800/30 rounded-lg p-4 mb-4'>
            <h2 className='text-purple-500 text-xs font-mono mb-3 tracking-widest'>ACHIEVEMENTS ({achievements.length}/{ACHIEVES.length})</h2>
            <div className='grid grid-cols-4 gap-2'>
              {ACHIEVES.map(a => (
                <div key={a.id} className={`text-center p-2 rounded-lg ${achievements.includes(a.id)?'bg-yellow-900/20 border border-yellow-700/30':'bg-gray-800/30 border border-gray-700/20 opacity-40'}`}>
                  <div className='text-2xl'>{a.icon}</div>
                  <div className='text-[10px] text-purple-300 mt-0.5'>{a.name}</div>
                </div>
              ))}
            </div>
          </div>
        )}

        <div className='bg-red-950/30 border border-red-800/30 rounded-lg p-4'>
          <h2 className='text-red-500 text-xs font-mono mb-3 tracking-widest'>⚠️ DANGER ZONE</h2>
          <button onClick={resetAll}
            className='bg-red-900/40 hover:bg-red-800/40 text-red-300 border border-red-700/40 px-4 py-2 rounded-lg text-sm transition w-full font-mono'>
            🗑️ DROP DATABASE (Reset All)
          </button>
          <p className='text-red-600/40 text-xs mt-2 text-center'>This action cannot be undone. Just like that one time in production.</p>
        </div>

        {saved && (
          <div className='fixed bottom-4 right-4 bg-green-900/80 border border-green-700/40 text-green-300 px-4 py-2 rounded-lg text-sm font-mono anim-fade z-50'>
            ✓ Config saved
          </div>
        )}
      </div>
    </div>
  );
}
